package com.example.demo.domain;

import java.util.Date;

public class OutOrder{ 	 private Integer id; 	 private Integer userId; 	 private Date time; 	 private Double totalPrice; 	 private Integer isPayment; 	 private Double interestRate; 	 private Double arrears; 	 private Date createTime; 	 private Date updateTime; 	 private Integer deleted; 	 public OutOrder() {
 	 	 super();	}
 	 public void setId(Integer id){ 		 this.id=id; 	 } 	 public Integer getId(){ 		 return this.id; 	 } 	 public void setUserId(Integer userId){ 		 this.userId=userId; 	 } 	 public Integer getUserId(){ 		 return this.userId; 	 } 	 public void setTime(Date time){ 		 this.time=time; 	 } 	 public Date getTime(){ 		 return this.time; 	 } 	 public void setTotalPrice(Double totalPrice){ 		 this.totalPrice=totalPrice; 	 } 	 public Double getTotalPrice(){ 		 return this.totalPrice; 	 } 	 public void setIsPayment(Integer isPayment){ 		 this.isPayment=isPayment; 	 } 	 public Integer getIsPayment(){ 		 return this.isPayment; 	 } 	 public void setInterestRate(Double interestRate){ 		 this.interestRate=interestRate; 	 } 	 public Double getInterestRate(){ 		 return this.interestRate; 	 } 	 public void setArrears(Double arrears){ 		 this.arrears=arrears; 	 } 	 public Double getArrears(){ 		 return this.arrears; 	 } 	 public void setCreateTime(Date createTime){ 		 this.createTime=createTime; 	 } 	 public Date getCreateTime(){ 		 return this.createTime; 	 } 	 public void setUpdateTime(Date updateTime){ 		 this.updateTime=updateTime; 	 } 	 public Date getUpdateTime(){ 		 return this.updateTime; 	 } 	 public void setDeleted(Integer deleted){ 		 this.deleted=deleted; 	 } 	 public Integer getDeleted(){ 		 return this.deleted; 	 }
}